import React from 'react';
import { BrowserRouter as Router, Route, Switch } from 'react-router-dom';
import CourseHomepage from './CourseHomepage';

function App() {
  return (
    <Router>
      <Switch>
        <Route path="/course/:id/enrolled" render={() => <CourseHomepage isEnrolled={true} />} />
        <Route path="/course/:id" render={() => <CourseHomepage isEnrolled={false} />} />
        {/* Add other routes as needed */}
      </Switch>
    </Router>
  );
}

export default App;
